import { SearchListItem } from './SearchListItem';

export const SearchList = ({ result, isSearching }) => {

  const ListResult = ()=>{

    console.log( result );
    if( !result?.length)
       return <p className='search-top'>No existen resultados</p>

    result?.map((value)=>{        
        return(<SearchListItem
            key = {value.id}
            {...value}
        />)
    })
  }
  return (
    <div>     
      {!result?.length && isSearching && <p className='search--top'>No existen result</p>}      
      { result?.map((value)=>{
            return(                
                <SearchListItem
                    key = { value.id }
                    {...value}
                />
            )
        })}        
    </div>
  )
}
